import {ContainerRanking} from '../style/style'
import api from '../services/services'
import axios from 'axios'


let retorno = null

async function RankingPlayers () {
     retorno = await axios.get('http://localhost:3333/busca')
    
}
RankingPlayers()

function Ranking () {
    return (
        retorno.data.map((element,i) => {
            return (
                <div>
                    Nome: {element.name}
                </div>
            )
        })
    )
}


export default Ranking
